description:
With the shutdown of the Warhammer Online - Age of Reckoning servers it is now not possible to download the client through EA's servers. This is the full v1.4.8 and final patched game ready to download. 

Why download this file if the game servers are shut down? There is a private server that is fully free to play here:
  &lt;a href=&quot;
http://www.warhammer-server.com/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.warhammer-server.com/&lt;/a&gt;

Use this game client plus their server launcher to log in. Simply create a registered user on their forum and you are ready to go!

Please remember to SEED!
